import React from 'react'
import Product from './Product.jsx'


export default function StoreContainer(products) {

    let gridLayout = products.map((product, i) => {
        return(
            <Product key={i} name={product.name} image={product.image_url} />
        )
    })


    return (
        {gridLayout}
    )
}
